  `print_desc` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '打印订单页面下方说明文字',
  `sales` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '店铺销售额（不计算退款）',
